import './exampleFilm.css'
import {BigCard} from "../../shared/BigCard/BigCard";
import films from "../../processes/films.json";
import VideoFilm from "../../shared/VideoFilm/VideoFilm";


export default function ExampleFilm (){
    let valueKeyLocalStorage = localStorage.getItem('key');
    const exampleKeyFilms  =  --valueKeyLocalStorage;
    let film = films[exampleKeyFilms -1];
    return(
        <main>
            <p style={{
                border: '1px solid red',
                marginTop: '30vh'
            }}>{film[exampleKeyFilms].name}</p>
            <VideoFilm src={film.video}/>
            <section className='contentFilm__bigSectionCard'>
                <BigCard src={films.image} key={films.key} name={films.name} rental={films.rental} example={films.example} style={{width: '32%'}}/>
            </section>
        </main>
    )
}
